import React, { useEffect } from 'react'
import App from 'next/app'
import classNames from 'classnames'
import  '@style/index.less'
import Nav from '@root/components/Nav'
import CopyRight from '@root/components/CopyRight'

import { 
  IStore
} from '@store/types';

import BaseAction from '@store/actions/baseAction'

import { Provider, connect } from 'react-redux'
import store from '@store/index'

class MyApp extends App {
  public classWrapperString = classNames({
    [`react-next-wrapper`]: true,
    [`theme-default`]: true
  })

  componentDidMount () {
    console.log(this.props)
  }

  render() {
    const { Component, pageProps } = this.props

    return (
      <Provider store={store}>
        <div className={this.classWrapperString} id='dw-next-container'>
          <div className='react-next-content'>
            <header>
              <Nav/>
            </header>
            <section>
              <Component {...pageProps} />
            </section>
            <CopyRight/>
          </div>
        </div>
      </Provider>
    )
  }
}

export default connect((state: IStore) => {
  return {
    ele: state.BaseStore.containerEle
  }
}, setContainerEle)(MyApp)
